import Link from "next/link";

export default () => (
    <header>
        <nav>
            <div>
                <ul>
                    <li>
                        <Link href={"/"}>
                            <a>Home</a>
                        </Link>
                    </li>
                    <li>
                        <Link href={"/about"}>
                            <a>About</a>
                        </Link>
                    </li>
                </ul>
            </div>
        </nav>

        <style jsx>{
            `
                ul {
                    displat: flex;
                }

                ul il{
                    margin-right: 20px;
                }
            `
        }</style>

    </header>
);
